CommonData.BannerCustomCSS:
#onetrust-banner-sdk {
	max-width: 570px !important;
	font-family: "Gilroy", "Proxima Nova", sans-serif !important;
	padding: 24px !important;
	border-radius: 8px !important;
}
@media screen and (max-width: 992px) {
	#onetrust-banner-sdk {
		max-width: 700px !important;
		left: 50% !important;
		transform: translatex(-50%) !important;
	}
}
@media screen and (max-width: 480px) {
	#onetrust-banner-sdk {
		left: 24px!important;
		right: 24px !important;
		bottom: 24px!important;
		transform: none !important;
		width: auto!important;
		min-width: auto;
	}
}
#onetrust-policy {
	margin: 0 !important;
}

#onetrust-policy-title {
	font-size: 18px !important;
	display: flex !important;
	padding: 0 0 8px 0 !important;
}

@media screen and (max-width: 480px) {
	#onetrust-policy-title {
		font-size: 16px !important;
	}
}

#onetrust-policy-text {
	font-size: 16px !important;
	padding: 0 !important;
}

#onetrust-policy-text a{
	margin-left: 0 !important;
}

#onetrust-close-btn-container {
	top: -10px !important;
	right: -10px !important;
}

.ot-sdk-container {
	padding: 0 !important;
}

#onetrust-banner-sdk #onetrust-policy-text {
	padding: 0;
	display: block !important;
	flex-direction: column;
	justify-content: flex-end;
	align-items: flex-end;
}

#onetrust-banner-sdk #onetrust-button-group-parent {
	margin: 16px 0 0 0;
	padding: 0 !important;
}

#onetrust-banner-sdk #onetrust-button-group-parent #onetrust-button-group {
	display: flex;
	flex-direction: row-reverse;
	float: none;
	justify-content: space-between;
	align-items: center;
}

@media screen and (max-width: 480px) {
	#onetrust-banner-sdk #onetrust-button-group-parent #onetrust-button-group {
		flex-direction: column-reverse;
		justify-content: center;
		align-items: flex-start;
	}
}

#onetrust-button-group .onetrust-banner-options {
	display: flex !important;
	float: none !important;
	max-width: none !important;
	flex-direction: row-reverse;
	gap: 8px;
	@media screen and (max-width: 480px) {
		margin-top: 8px;
		width: 100%!important;
	}
}

#onetrust-button-group .onetrust-banner-options button {
	margin: 0 !important;
	display: flex!important;
	font-size: 14px !important;
	border-radius: 8px;
	line-height: 1.2;
	justify-content: center;
	min-width: auto!important;
	width: auto!important;
	align-items: center;
}

@media screen and (max-width: 480px) {
	#onetrust-button-group .onetrust-banner-options button {
		min-width: 49%!important;
	}
}

#onetrust-button-group-parent .cookie-setting-link {
	margin: 0 !important;
	text-decoration: none !important;
	position: relative !important;
	font-size: 14px !important;
	border: none !important;
	display: inline-flex;
	padding-right: 15px !important;
	background: transparent !important;
	max-width: fit-content !important;
	min-width: fit-content!important;
	line-height: 1.35;
}

#onetrust-button-group-parent .cookie-setting-link::before {
content: ' ';
		width: 8px;
		height: 8px;
		border-width: 1px 1px 0 0;
		border-style: solid;
		margin: 10px;
		position: absolute;
		right: -20px;
		top: 7px;
		transform: rotate(45deg);
}

#onetrust-button-group-parent .cookie-setting-link::after {
	content: ' ';
	position: absolute;
	right: -11px;
	top: 21px;
	height: 1px;
	box-shadow: inset 0 0 0 15px;
	width: 15px;
}
